import React from "react";
import { NavLink } from "react-router-dom";

const Main = () => {
  return (
    <div>
      <NavLink to="/app">Home</NavLink>
      <NavLink to="/page-one">Destination</NavLink>
      <NavLink to="/Page-two">Experiences</NavLink>
      <NavLink to="/Page-three">Contact</NavLink>

      <h1>this is about main page </h1>
    </div>
  );
};

export default Main;
